import { strict as assert } from "assert";
import mergeAdvanced from "object-merge-advanced";

assert.deepEqual(
  mergeAdvanced(
    {
      a: ["c"],
      m: "n",
    },
    {
      a: "b",
      k: "l",
    },
    {
      ignoreKeys: ["a"],
    }
  ),
  {
    a: ["c"],
    k: "l",
    m: "n",
  }
);
